import Todos from './components/Todos/Todos'
import WeatherDisplay from './WitherDisplay'

/**
 * The main component of the application.
 * Renders the Todos component inside a div with the class name 'app'.
 *
 * @returns {JSX.Element} The rendered component.
 */
function App() {
  return (
    <div className='app'> {/* className important */}
      <section className='todos'> {/* className important */}
        <header>
          <h1>To-Do List</h1>
          {/* WeatherDisplay component inserted below the main heading */}
          <WeatherDisplay city={city} />
        </header>
        <Todos />
      </section>
    </div>
  )
}

export default App
